Brooklyn's Finest (2009)  

Verenigde Staten
Actie / Misdaad
140 minuten

geregisseerd door Antoine Fuqua
met Richard Gere, Don Cheadle en Ethan Hawke

Het verhaal van drie agenten in Brooklyn uit verschillende onderdelen van het korps. Na een tijd kruisen hun wegen als ze met dezelfde misdaad te maken krijgen.

